/* VCD dumping functions */
MOD_mkTbFftPipelined & mkTbFftPipelined_backing(tSimStateHdl simHdl)
{
  static MOD_mkTbFftPipelined *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkTbFftPipelined(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
